const Login = (props) => {
  const handleInputChange = event => {
    const { name, value } = event.target

  }

  return (
    <form onSubmit={undefined}>
      <input placeholder="username" value={props.usernanme} name="username" type="text onChange{handleInputChange}" />
      <input placeholder="password" value={props.password} name="password" type="text onChange{handleInputChange}" />
      <input type="submit" value="Log In" />
    </form>
  )
}

